Level3.prototype.dispose = function(all) {
    if (this.loaded) {
        if (all) {
            this.loaded = false;
            this.coins = null;
        }
        this.enemies = null;
        this.tiles = null;
        try {
            if (this.music !== null) {
                this.music.stop();
            }
        } catch (e) {}
        this.music = null;
    }
};

Level3.prototype.checkpoint = function(deltatime) {
    var tileX = (this.camera.x + Config.worldWidth / 2 - Config.heroSize / 2) / Config.tileSize;
    var tileY = (this.camera.y + Config.worldHeight / 2 + Config.heroSize / 2) / Config.tileSize;
    
    if (this.isCheckpoint) {
        this.checkpointTime += deltatime;
        if (this.checkpointTime >= this.checkpointTimeLimit) {
            this.isCheckpoint = false;
            this.checkpointTime = 0;
        }
    }
    console.log("tileX: " + tileX + " tileY: " + tileY);
    if (tileX >= 13 && tileX <= 14 && tileY >= 70 && tileY <= 72) {
        this.isCheckpoint = true;
        this.startX = Config.tileSize * 13 - Config.worldWidth / 2 + Config.heroSize / 2;
        this.startY = Config.tileSize * 71 - Config.worldHeight / 2 - Config.heroSize / 2;
    } else if (tileX >= 9 && tileX <= 10 && tileY >= 55 && tileY <= 57) {
        this.isCheckpoint = true;
        this.startX = Config.tileSize * 9 - Config.worldWidth / 2 + Config.heroSize / 2;
        this.startY = Config.tileSize * 56 - Config.worldHeight / 2 - Config.heroSize / 2;
    } else if (tileX >= 14 && tileX <= 15 && tileY >= 42 && tileY <= 44) {
        this.isCheckpoint = true;
        this.startX = Config.tileSize * 14 - Config.worldWidth / 2 + Config.heroSize / 2;
        this.startY = Config.tileSize * 43 - Config.worldHeight / 2 - Config.heroSize / 2;
    } else if (tileX >= 14 && tileX <= 15 && tileY >= 18 && tileY <= 20) {
        this.isCheckpoint = true;
        this.startX = Config.tileSize * 14 - Config.worldWidth / 2 + Config.heroSize / 2;
        this.startY = Config.tileSize * 19 - Config.worldHeight / 2 - Config.heroSize / 2;
    } else if (tileX >= 40 && tileX <= 41 && tileY >= 5 && tileY <= 7) {
        this.isCheckpoint = true;
        this.startX = Config.tileSize * 40 - Config.worldWidth / 2 + Config.heroSize / 2;
        this.startY = Config.tileSize * 6 - Config.worldHeight / 2 - Config.heroSize / 2;
    } else if (tileX >= 68 && tileX <= 69 && tileY >= 5 && tileY <= 7) {
        this.isCheckpoint = true;
        this.startX = Config.tileSize * 68 - Config.worldWidth / 2 + Config.heroSize / 2;
        this.startY = Config.tileSize * 6 - Config.worldHeight / 2 - Config.heroSize / 2;
    } else if (tileX >= 104 && tileX <= 105 && tileY >= 10 && tileY <= 12) {
        this.isCheckpoint = true;
        this.startX = Config.tileSize * 104 - Config.worldWidth / 2 + Config.heroSize / 2;
        this.startY = Config.tileSize * 11 - Config.worldHeight / 2 - Config.heroSize / 2;
    }
};